import "./App.css";
import { Route } from "react-router-dom";
import Homepage from "./Pages/Homepage";
import ChatPage from "./Pages/ChatPage";
function App() {
  return (
    <div className="App">
      <Route path="/" element={<Homepage />} exact />
      <Route path="/chats" element={<ChatPage />} />
    </div>
  );
}

export default App;
